import Layout from "./components/Layout";
import PageTitle from "./components/PageTitle";

const About = () => (
  <Layout>
    <PageTitle title="about Me" />
    <img
      className="dancing-avatar"
      src="/img/dancing.png"
      alt="dancing-avatar"
    />
  </Layout>
);

export default About;
